#include <bits/stdc++.h>using namespace std;const int N = 200005;vector<int> adj[N];bool vis[N];bool ans;void dfs(int u,int p){	vis[u]=1;	for(int v:adj[u]){		if(v==p) continue;		if(vis[v]) ans=true;		else{			dfs(v,u);		}	}}int main(){	int n,m;	cin>>n>>m;	for(int i=0;i<m;i++){		int a,b;		cin>>a>>b;		adj[a].push_back(b);		adj[b].push_back(a);	}	dfs(1,0);	cout << (ans?"YES":"NO");}